/* HOMEPAGE - INDEX.JS */

import React from "react";

import Footer from '../Footer';


export default function Homepage() {
    return (
        <div className="homepage">
            <p>Je SUIS DANS LE DOSSIER HOMEPAGE ET DANS LE FICHIER INDEX.JS</p>
            <img src="https://img.icons8.com/nolan/64/video-playlist.png" alt="logo" />
            <div className="titles">
                <h1>
                    Player<br />Video
                </h1>
                <h2>
                    To Upload. To compress. To view video files.
                </h2>
            </div>
            <footer className="footer">
                <p className="footer-contact-text">Presented by <span><a href="https://github.com/SYB-SFLA">Sophie BAYRAM</a></span></p>
            </footer>
            {/* <Footer /> */}
        </div>

    )
}
